import React, { useState } from "react";
import { Formik, Form, Field, useFormik } from "formik";
import * as Yup from "yup";
import TextField from "@material-ui/core/TextField";
import Password from "./FormikField/PasswordInput";
import { Select } from "formik-material-ui";
import MenuItem from "@material-ui/core/MenuItem";
import InputLabel from "@material-ui/core/InputLabel";
import FormControl from "@material-ui/core/FormControl";

function SignUpFormCompanyy() {
  const initialValues = {
    name: "",
    email: "",
    city: "",
    password: "",
    confirmPassword: "",
  };
  const mockitems = [
    { label: "ist", value: 34 },
    { label: "ankara", value: 6 },
  ];
  const yup = require("yup");
  require("yup-password")(yup);

  function handleSubmit(values) {
    console.log("afahefn");
    console.log(values);
  }
  const sigUpSchema = Yup.object().shape({
    name: Yup.string()
      .min(2, "Company name is too short")
      .required("Company name is required"),
    email: Yup.string()
      .email("Please enter a valid email")
      .required("Email is required"),
    city: Yup.string().required("Please select a city"),
    password: Yup.string()
      .password()
      .required("Password is required")
      .min(8, "pass 8")
      .minLowercase(1, "has min low")
      .minUppercase(1, "has min high")
      .minNumber(1, "has min num")
      .minSymbol(1, "has min sym"),
    confirmPassword: Yup.string().required("is req"),
  });
  return (
    <div>
      <h1>Sign Up</h1>
      <Formik
        initialValues={initialValues}
        onSubmit={handleSubmit}
        validationSchema={sigUpSchema}
      >
        {({ dirty, isValid }) => {
          return (
            <Form>
              <div>
                <TextField
                  id="standard-basic"
                  label="Company Name"
                  name="name"
                  required
                  fullWidth
                />
              </div>
              <br />
              <div>
                <TextField
                  id="standard-basic"
                  label="Email"
                  name="email"
                  type="email"
                  required
                  fullWidth
                />
              </div>
              <br />
              <div>
                <Password name="password" label="Password"></Password>
              </div>
              <br />
              <div>
                <FormControl>
                  <InputLabel>City</InputLabel>
                  <Field component={Select} name="city">
                    {mockitems.map((item) => (
                      <MenuItem value={item.value}>{item.label}</MenuItem>
                    ))}
                  </Field>
                </FormControl>
              </div>
              <div>
                <Password
                  name="confirmPassword"
                  label="Confirm Password"
                ></Password>
              </div>
              <br />
              <button disabled={!dirty || !isValid} type="submit">
                Submit
              </button>
            </Form>
          );
        }}
      </Formik>
    </div>
  );
}

export default SignUpFormCompanyy;
